INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'France', 'Welcoming more than 89 million visitors per year, France is the most visited country in the world. Little wonder, owing to the eternal pull of the cosmopolitan capital of Paris. City breaks to the French capital are always popular with couples, who long to experience the romance of Paris’s historic streets and glistening Eiffel Tower. Furthermore, Paris is a shopping paradise and boasts some of the finest restaurants in the world. On the other hand, France offers an array of Mediterranean beaches along its glamorous Côte d’Azur. The French Riviera is awash with upmarket resort towns and coastal villages, making it another top destination for tourism. France’s diversity doesn’t stop there, as the chateaux and vineyards of the Loire Valley are another reason to visit this European nation.', , 3, 0);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(3, 'Spain', 'One of Europe\'s biggest hitters for good reason, Spain pulls tourists in by the millions thanks to its warm weather, laidback vibe and excellent food and wine. Plus, of course, there are some of Europe\'s best beach resorts, mountains, and cultural cities such as Madrid, Seville and Barcelona.', , 3, 0);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Morrocco', 'Morocco is known for being one of the most tolerant of the Arab nations. The country is relatively safe, peaceful and stable. Moroccan people, both Arabic and Berber, are also noted for their warm hospitality and friendly nature.', , 2, 0);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(5, 'Mexico', 'You\'ll find incredible food, sensational beaches, charming towns and historical remains. While the beach resorts around Cancun attract the bulk of visitors, those who want more than a fly and flop go for Mexico City\'s cultural heft, the coastline of Baja California and traditional towns such as Oaxaca.', , 4, 0);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(6, 'China', 'China defies easy categorization. A nation of more than 1.3 billion people, stretching from the barren Taklamakan desert in the west to the booming metropolis of Shanghai in the east, it\'s ultramodern and deeply traditional. Getting to know it can take a lifetime, making it a source of endless fascination for explorers and adventurers down the years. Delve into the culture clash of imperial and communist China in Beijing\'s Tiananmen Square, bordered by the Forbidden City and Mao\'s Mausoleum; marvel at the towering limestone mountains of Guilin; and be stunned by the archaeologically arresting Terracotta Army in Xian. China\'s joy lies in its scope for endless discovery.\r\n', , 1, 0);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(7, 'Brazil', 'Brazil\'s relentlessness, beauty and diversity make it South America\'s go-to destination for travelers looking to find everything in one place. Rio\'s world-famous Copacabana and Ipanema are the beaches first-timers flock to. But nearby Costa Verde, where the jungle meets the sea, is home to equally stunning stretches of sand for those keen to explore. Sao Paolo\'s hectic streets offer an insight into Brazil\'s rapid development, while historic Salvador, with its colorful architecture, showcases the country\'s past. Then, of course, there\'s the Amazon and its rainforest, a vast natural world of rare species and indigenous tribes just waiting to be discovered.', , 5, 0);

